memory = {};
memory.lasttyped = '';
memory.draftName = 'draft';

memory.getMemory = function() {
  return memory.lasttyped;
}

memory.setMemory = function(inputch, cursorstr) {
  if (!inputch) {
    return;
  }
  if (!!memory.lasttyped) {
    var len = memory.lasttyped.length;
    if (len > 3) {
      memory.lasttyped = memory.lasttyped.substr(
        memory.lasttyped.length - 3
      );
    }
    memory.lasttyped += inputch;
  } else {
    memory.lasttyped = inputch;
  }
}

memory.clearMemory = function() {
  memory.lasttyped = '';
}

memory.setMemoryAndTimer = function(inputch, cursorstr) {
  clearTimeout(memory.timer);
  memory.setMemory(inputch, cursorstr);
  memory.timer = setTimeout(memory.clearMemoryAndTimer, 2000);
}

memory.clearMemoryAndTimer = function() {
  clearTimeout(memory.timer);
  memory.clearMemory();
}

////////////////////////////////

memory.hasName = function(name) {
	return (name in localStorage);
}

memory.saveAs = function(contents, name) {
	if (contents && contents.length > 4) { // to ignore "<br>"
	  localStorage[name] = contents;
	  // if (console) console.log("saved: " + contents);
	  return true;
	}
	return false;
}

memory.saveContents = function(contents, name) {
	if (memory.hasName(name)) {
		var str = "A file by name '" + name + "' already exists.\n Do you want to overwrite it?"
		var yes = confirm(str);
		if (!yes) {
			return;
		}
	}
	return memory.saveAs(contents, name);
}

memory.getHour = function(date_obj) {
	var h = date_obj.getHours();
	if (h <= 12) {
		return h + "am";
	}
	return (h-12) + "pm";
}

// Returns null if draft is not saved (either because no content, or some error).
memory.saveDraft = function(contents) {
	var d = new Date();
	var base_name = memory.draftName + " on " + d.toDateString() + " at " + memory.getHour(d);
	var draft_name = base_name;
	// check if a draft with this name already exists, and if so, do not overwrite that
	// content if it is substantially different than the current one.
	for (var i = 1; i < 100; ++i) {
		draft_name = base_name + " (version " + i + ")";
		var tmp_content = memory.getSavedContent(draft_name);
		if (tmp_content == null) {
			break; // can save in this name
		} else {
			// check for content size.
			var s1 = tmp_content.length;
			var s2 = contents.length;
			if ((s2 > s1) || (s1-s2 < 15)) {
				// can overwrite this draft
				break;
			}
			// create a new name
		}
	}
	if (memory.saveAs(contents, draft_name)) {
		var date_str = d.toString();
		var gmt = date_str.indexOf("GMT");
		date_str = date_str.substr(0, gmt);
		return date_str;
	}
	return null;
}

// Returns null if content not found.
memory.getSavedContent = function(name) {
	if (!memory.hasName(name)) {
		return null;
	}
	return localStorage[name];
}

memory.getSavedNames = function() {
	var names = [];
	for (name in localStorage) {
		names.push(name);
	}
	return names;
}

memory.deleteContent = function(name) {
	if (name in localStorage) {
		localStorage.removeItem(name);
	}
}

keyslayout = {};

keyslayout.inversemap = {};

keyslayout.fillInverseMap = function() {
  if ('filled' in keyslayout) {
    return;
  }

  keyslayout.orderedkeys = [];
  var endindex = 200;

  for (var key in languagemappings) {
    if (!key) continue;
    var value = languagemappings[key];
    if (value in keyslayout.inversemap) {
      keyslayout.inversemap[value] += ", ";
      keyslayout.inversemap[value] += key;
    } else {
      keyslayout.inversemap[value] = key;
      if (value.length == 1) {
        keyslayout.orderedkeys[
          value.charCodeAt(0) - language.startoffset] = value;
      } else {
        // combo letters. append at end.
        keyslayout.orderedkeys[endindex++] = value;
      }
    }
  }

  keyslayout.filled = 1;
}

keyslayout.displayMappings = function(pid, opt_deletemappings) {
  keyslayout.pane = goog.dom.getElement(pid);
  keyslayout.pane.innerHTML = '';

  var node = goog.dom.createElement('div');
  node.innerHTML =
    '<br/>&nbsp;<b><a href=# onclick="keyslayout.addNewMapping()">' +
    'Add custom mapping' +
    '</a></b><br/><br/>';
  goog.dom.appendChild(keyslayout.pane, node);

  keyslayout.fillInverseMap();

  var len = keyslayout.orderedkeys.length;
  var divnode;
  var added = 0;
  for (var i = 0; i < len; i++) {
    if (added%27 == 0) {
      divnode = goog.dom.createElement('div');
      divnode.className = 'mappingkey';
      goog.dom.appendChild(keyslayout.pane, divnode);
    }
    var value = keyslayout.orderedkeys[i];
    if (!!value) {
      var key = keyslayout.inversemap[value];
      var node = goog.dom.createElement('div');
      node.innerHTML = keyslayout.htmlForKeyValue(key, value);
      goog.dom.appendChild(divnode, node);
      added++;
    }
  }

  if (opt_deletemappings) {
    keyslayout.deleteMappings();
  }
}

keyslayout.htmlForKeyValue = function(key, value) {
  return value + ' -- ' + key;
}

keyslayout.latinLetterHandler = function(key) {
    languagemappings[key] = keyslayout.newvalue;
    language.useradded[keyslayout.newvalue] = 1;
    keyslayout.displayMappings('mappings', true);
    keyslayout.newvalue = null;
}

keyslayout.languageLetterHandler = function(value) {
  if (!value) return;
  keyslayout.newvalue = value;
  var prompt = new goog.ui.Prompt(
       'Corresponding Lating alphabets',
       'Enter the Latin alphabets to map "' + value + '"',
       keyslayout.latinLetterHandler);
  prompt.setVisible(true);
}

keyslayout.addNewMapping = function() {
   var prompt = new goog.ui.Prompt(
     'New ' + language.name + ' key',
     'Enter the ' + language.name + ' letter:',
      keyslayout.languageLetterHandler);
   prompt.setVisible(true);
}

keyslayout.deleteMappings = function() {
    delete keyslayout.orderedkeys;
    delete keyslayout.inversemap;
    delete keyslayout.filled;
    keyslayout.inversemap = {};
}


// To change language, do <languagename>.setAsTypingLanguage();
language = {};
languagemappings = {};

om = {};  // language independent.
om.ProcessKeypressEvent = function(e, field) {
  var hascharcode = 'charCode' in e;
  var ch = hascharcode ?
           String.fromCharCode(e.charCode) :
           '';
  var control_pressed = ('ctrlKey' in e) && e.ctrlKey;
  // . also has keycode = 46 for some reason
  var delete_pressed = (e.keyCode == 46) && (ch != ".");
  if (!hascharcode || !ch ||
       e.keyCode == goog.events.KeyCodes.ENTER ||
       delete_pressed ||
       control_pressed) {
    // not a visible character. clear memory.
    memory.clearMemoryAndTimer();
    return true;
  }

  var MapClear = om.getMappingFromEnglish(ch);

  if (!MapClear) {
    // no mapping for this char. display it as is.
    // also add it to memory.
    memory.setMemoryAndTimer(ch, strbeforecursor);
    return true;
  }

  MapClear.inputchar = ch;
  var strbeforecursor =
      om.insertMappedString(MapClear, field);

  if (!!strbeforecursor) {
    e.preventDefault();
    memory.setMemoryAndTimer(ch, strbeforecursor);
  } else {
    // no chars added. maybe a backspace. or some neutralizer.
    memory.clearMemoryAndTimer();
  }
}

om.getMappingFromEnglish = function(inputch) {
  if (!inputch) {
    return null;
  }
  var obj = {};
  obj.str = '';
  obj.backspace = false;
  obj.backspaceonlyvirama = false;

  if (!!memory.getMemory()) {
    var str = memory.getMemory() + inputch;
    if (str in languagemappings) {
      // Note: this function only removes virama this way:
      // sV+h becomes shV.
      var mapping = languagemappings[str];
      mapping = om.addOrRemoveViramaToMapping(
                mapping, str);
      obj.str = mapping;
      obj.backspace = true;
      return obj;
    }
  }

  // either no prev memories, or
  // str is not in mappings. anyways clear memory.
  memory.clearMemoryAndTimer();

  if (inputch in languagemappings) {
    var mapping = languagemappings[inputch];
    mapping = om.addOrRemoveViramaToMapping(
                mapping,
                inputch);
    obj.str = mapping;
    // if the input char is a vowel and prev sanskrit char
    // was a virama, then remove the latter.
    if (mapping in language.matra) {
      obj.backspaceonlyvirama = true;
    }
    return obj;
  }
  return null;
}

om.insertMappedString = function(MapClear, field) {
  var mappedstr = MapClear.str;
  var inputchar = MapClear.inputchar;
  // for cases like sV + h to make it shV (replace
  // sV with shV.)
  var clearprevchar = MapClear.backspace;
  var clearonlyvirama = MapClear.backspaceonlyvirama;
  var NVO = utils.getNodeValueOffsetAtCursor(field);
  if (!NVO) {
    return false;
  }
  var node = NVO.node;
  var oldvalue = NVO.value;
  var offset = NVO.offset;
  var newstringbeforecursor = mappedstr;
  var newvalue = newstringbeforecursor;
  if (!!oldvalue) {
    // slice in str into oldvalue.
    var oldstringbeforecursor = oldvalue.substr(0, offset);
    if (clearprevchar && oldstringbeforecursor.length > 0) {
      oldstringbeforecursor = om.backspaceAndRemoveVirama(oldstringbeforecursor);
    } else if (clearonlyvirama && oldstringbeforecursor.length > 0) {
      var oldlen = oldstringbeforecursor.length;
      oldstringbeforecursor = om.backspaceOnlyVirama(oldstringbeforecursor);
      var newlen = oldstringbeforecursor.length;
      if (newlen == oldlen-1) {
        // virama was removed.
        // if the input was 'a', mission accomplished.
        // nothing more to append.
        // Note: we used mappedstr as inputchar is not available.
        //if (mappedstr == language.a) {
        if (inputchar == 'a') {
          mappedstr = '';
        }
      }
    }

    // If at the start of a line or word, convert matras
    // to their corresponding vowel forms.
    // Typical sequence of events that happen when one types
    // "o" followed by "o" as a new word:
    // 1) the first "o" is converted to matra.o above, which is then
    //  converted to vowel.o here.
    // 2) the second "o" is attached to the first and mapped to
    //  matra.oo, which triggers a backspace. This backspace removes
    //  vowel.o and makes it matra.oo above. The below code then
    //  converts matra.oo to vowel.oo.
    // 3) only for the input char 'a', this sequence is disrupted
    //  because of the above code to handle removal of virama.
    // 4) Hence only for letter 'a', we allow an exception.
    var isWordStart = !oldstringbeforecursor ||
      (oldstringbeforecursor.charAt(
        oldstringbeforecursor.length-1) == ' ') ||
      (oldstringbeforecursor.charAt(
        oldstringbeforecursor.length-1).charCodeAt(0) == 160);
    if (isWordStart) {
        // Convert matras to vowels.
        if (mappedstr in language.matra_to_vowel) {
          mappedstr = language.matra_to_vowel[mappedstr];
        }
    }
    // Exception handling for case when we have language.A before
    // cursor and the input is 'a'.
    if (!!oldstringbeforecursor &&
        (oldstringbeforecursor.charAt(
          oldstringbeforecursor.length-1) == language.A) &&
        (inputchar == 'a')) {
      // remove language.A and insert language.AA
      oldstringbeforecursor = om.backspaceAndRemoveVirama(oldstringbeforecursor);
      mappedstr = language.AA;
    }

    newstringbeforecursor = oldstringbeforecursor + mappedstr;
    newvalue = newstringbeforecursor + oldvalue.substr(offset);
  }

  // update the field.
  if (utils.IsTextNode(node)) {
    goog.dom.setTextContent(node, newvalue);
  } else {
    node.innerHTML = newvalue;
  }

  // to handle cases where sometimes the caret goes missing.
  var win = field.editableDomHelper.getWindow();
  utils.placeCursorAfterStringInNode(win, node, newstringbeforecursor);

  var ret = om.getSuffix(newstringbeforecursor);
  return ret;
}


om.getSuffix = function(str) {
  if (!str) return '';
  return str.substr(str.length - 1);
}

// F("ॐ", "om")
om.addOrRemoveViramaToMapping =
function(mapstr, orgstr) {
  if ((mapstr in language.matra) ||
      (mapstr in language.vowel) ||
      (mapstr in language.digits) ||
      (mapstr in language.punctuations) ||
      (mapstr in language.useradded)) {
    return mapstr;
  }
  return mapstr + language.virama;
}

om.backspaceAndRemoveVirama = function(str) {
  if (!str) return str;
  var len = str.length;
  if (len == 1) return '';
  if (str[len - 1] == language.virama) {
    str = str.substr(0, len - 1);
  }
  return om.backspace(str);
}
om.backspaceOnlyVirama = function(str) {
  if (!str) return str;
  var len = str.length;
  if (len > 0 && str[len - 1] == language.virama) {
    str = str.substr(0, len - 1);
  }
  return str;
}
om.backspace = function(str) {
  if (!str) return str;
  var len = str.length;
  if (len == 1) return '';
  return str.substr(0, len - 1);
}
om.removeViramaFromEnd = function(str) {
  if (!str) return str;
  var len = str.length;
  if (str[len - 1] == language.virama) {
    str = str.substr(0, len - 1);
  }
  return str;
}
